import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Card from 'react-bootstrap/Card';
import Nav from 'react-bootstrap/Nav';
import Tab from 'react-bootstrap/Tab';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import ServerItem from './ServerItem';
import '../Styles/ServerList.css';

function ServerList({ items, onDelete, setItems }) {
    const [selectedItemIndex, setSelectedItemIndex] = useState(null);
    const [selectedPort, setSelectedPort] = useState('1');
    const [selectMode, setSelectMode] = useState(false);

    const handleSelectItem = (index) => {
        setSelectedItemIndex(index);
    };

    const handlePortSelection = (port) => {
        setSelectedPort(port);
    };

    const handleDeleteSelected = () => {
        const updatedItems = items.filter((item, index) => !selectedItems.includes(index));
        onDelete(updatedItems);
        setItems(updatedItems);
        setSelectMode(false);
        localStorage.setItem('items', JSON.stringify(updatedItems));
    };

    const handleCancelDelete = () => {
        setSelectedItems([]);
        setSelectMode(false);
    };

    if (items.length === 0) {
        return (
            <Card>
                <Card.Body>
                    <Card.Title>Список элементов</Card.Title>
                    <Card.Text className="text-center">Список пуст</Card.Text>
                </Card.Body>
            </Card>
        );
    }

    return (
        <Tab.Container>
            <Row>
                <Col sm={3}>
                    <Card style={{ height: '100%' }} className="server-list-card justify-content-center">
                        <Card.Body className="flex-column">
                            <Card.Title>Список элементов</Card.Title>
                            <Nav justify variant="pills" className="flex-column">
                                {items.map((item, index) => (
                                    <Nav.Item
                                        key={index}
                                        className="d-flex align-items-center"
                                        onClick={() => handleSelectItem(index)}
                                        active={selectedItemIndex === index}
                                    >
                                        {selectMode && (
                                            <Form.Check
                                                className="mx-2"
                                                type="checkbox"
                                                checked={selectedItems.includes(index)}
                                                onChange={() => handleSelectItem(index)}
                                            />
                                        )}
                                        <Nav.Link className="mx-auto">{item.name}</Nav.Link>
                                    </Nav.Item>
                                ))}
                            </Nav>
                        </Card.Body>
                    </Card>
                </Col>

                <Col className="d-flex flex-grow-1">
                    <Tab.Content className="wd-100">
                        {items.map((item, index) => (
                            <Tab.Pane
                                key={index}
                                eventKey={index}
                                className={`d-flex align-items-center ${selectedItemIndex === index ? 'active' : ''}`}
                            >
                                {selectedItemIndex === index && (
                                    <ServerItem
                                        item={item}
                                        selectedPort={selectedPort}
                                        onPortSelection={handlePortSelection}
                                    />
                                )}
                            </Tab.Pane>
                        ))}
                    </Tab.Content>
                </Col>
            </Row>

            <Row className="my-1">
                <Col sm={3}>
                    {selectMode ? (
                        <div className="d-flex justify-content-between mb-3">
                            <Button variant="outline-danger" onClick={handleDeleteSelected}>
                                Удалить выбранные
                            </Button>
                            <Button variant="outline-secondary" onClick={handleCancelDelete}>
                                Отмена
                            </Button>
                        </div>
                    ) : (
                        <Button variant="outline-primary" onClick={() => setSelectMode(true)}>
                            Выбрать
                        </Button>
                    )}
                </Col>
            </Row>
        </Tab.Container>
    );
}

export default ServerList;
